import React from 'react';
import { useNavigate } from 'react-router-dom';

function BackToProjects() {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate('/projects');
  };

  return (
    <button onClick={handleBack}>Back to Projects</button>
  );
}

export default BackToProjects;
